import React from 'react';
import { Link } from 'react-router-dom';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';

function Phonenav({ setSelectedBrand }) {
  const handleBrandClick = (brand) => {
    setSelectedBrand(brand);
  };

  return (
    <Navbar fixed="top" collapseOnSelect expand="lg" className="bg-body-tertiary">
      <Container>
        <Navbar.Brand href="/dashboard">Headphones</Navbar.Brand> {/* Corrected 'HeadPhones' to 'Headphones' */}
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="me-auto">
            {['boAT', 'OnePlus', 'JBL', 'Boult', 'Sony', 'realme', 'ZEBRONICS', 'Samsung', 'Noise', 'pTron'].map((brand) => (
              <Nav.Link 
                as={Link} 
                to={`/headphones/${brand}`}  // Ensured the brand name is in lowercase
                key={brand}
                onClick={() => handleBrandClick(brand)} 
              >
                {brand.charAt(0).toUpperCase() + brand.slice(1).toLowerCase()}  {/* Corrected the capitalization */}
              </Nav.Link>
            ))}
          </Nav>
          <Nav>
            <Link to='/dashboard'><p>Back</p></Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default Phonenav;
